/*
 * @Descripttion:首页页面
 * @Author: zhaokh
 * @Date: 2020-01-29 14:34:29
 */
import React, { useState } from "react";
import Head from "next/head";
import axios from "axios";
import { Row, Col, List, Icon } from "antd";
import "../public/style/pages/index.css";
import Header from "../components/Header";
import Author from "../components/Author";
import Footer from "../components/Footer";

const Home = props => {
  console.log("333333333", props.data);
  const [myList, setLMylist] = useState(props);

  return (
    <div>
      <Head>
        <title>Home</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <Header />

      <Row className="common-main" type="flex" justify="center">
        <Col className="common-left" xs={24} sm={24} md={16} lg={18} xl={14}>
          <List
            header={<div>最新日志</div>}
            itemLayout="vertical"
            dataSource={myList}
            renderItem={item => (
              <List.Item>
                <div className="list-title">{item.title}</div>
                <div className="list-icon">
                  <span>
                    <Icon type="calendar" /> 2019-06-28
                  </span>
                  <span>
                    <Icon type="folder" /> 视频教程
                  </span>
                  <span>
                    <Icon type="fire" /> 5498人
                  </span>
                </div>
                <div className="list-context">{item.context}</div>
              </List.Item>
            )}
          />
        </Col>
        <Col className="common-right" xs={0} sm={0} md={7} lg={5} xl={4}>
          <Author />
        </Col>
        <Footer />
      </Row>
    </div>
  );
};

Home.getInitialProps = async () => {
  const promise = new Promise(resolve => {
    axios("http://localhost:7001/fontend/articals").then(res => {
      //console.log('远程获取数据结果:',res.data.data)
      resolve(res.data);
    });
  });

  return await promise;
  return await axios.get("http://localhost:7001/fontend/articals");
};

export default Home;
